import { useEffect, useState } from "react";
import Record from '../data/data.json';

function Gallery() {

    /* fetch random images from unsplash */
    document.body.appendChild(unsplash);
    const unsplash_url = 'https://source.unsplash.com/random/';
    const unsplash_img = document.createElement('img');
    unsplash_img.src = unsplash_url;
    unsplash.appendChild(unsplash_img);

    useEffect(() => {
        document.title = 'Cases';
    }, []);

    return (
        <div className="container mb-5">
            <div className="row">
                <h1 className="text-center">Cases</h1>
            </div>
            <div>
            </div>
        </div>
    );
}

export default Gallery;
